import { Box,Button, Typography  } from '@mui/material'
import React from 'react'

const CustomButton = () => {
  return (
            <Box>
                <Button variant='contained' >Login</Button>
                <Typography>Become a seller</Typography>
                <Typography>More</Typography>
            </Box>
        )
}

export default CustomButton
